// Import các thư viện và hooks cần thiết
import React, { useState } from 'react';
import './Contact.css';

/**
 * Contact Component - Hiển thị form liên hệ và thông tin liên lạc
 * @returns {JSX.Element} Form liên hệ và thông tin
 */
const Contact = () => {
  // Khởi tạo state quản lý dữ liệu form
  const [formData, setFormData] = useState({
    fullName: '',    // State lưu tên người dùng
    email: '',       // State lưu email
    phone: '',       // State lưu số điện thoại
    message: ''      // State lưu tin nhắn
  });

  // State quản lý thông báo
  const [notification, setNotification] = useState({
    show: false,     // Điều khiển hiển thị/ẩn thông báo
    type: '',        // Loại thông báo (success/error)
    message: ''      // Nội dung thông báo
  });

  // Hàm xử lý khi người dùng nhập liệu
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // Xử lý khi submit form
  const handleSubmit = (e) => {
    e.preventDefault();  // Ngăn form reload trang
    
    // Kiểm tra các trường bắt buộc
    if (!formData.fullName || !formData.email || !formData.message) {
      setNotification({
        show: true,
        type: 'error',
        message: 'Vui lòng điền đầy đủ thông tin bắt buộc'
      });
      return;
    }

    // Xử lý thành công
    setNotification({
      show: true,
      type: 'success',
      message: 'Gửi thông tin thành công!'
    });

    // Reset form
    setFormData({
      fullName: '',
      email: '',
      phone: '',
      message: ''
    });
  };

  return (
    // Container chính của trang
    <div className="contact-wrapper">
      {/* Phần header */}
      <div className="contact-header">
        <h1>Liên Hệ</h1>
        <p>Hãy để lại thông tin, chúng tôi sẽ liên hệ lại với bạn sớm nhất</p>
      </div>

      {/* Container chứa form và thông tin */}
      <div className="contact-content">
        {/* Phần thông tin liên hệ bên trái */}
        <div className="contact-info">
          <div className="info-box">
            {/* Từng mục thông tin */}
            <div className="info-item">
              <i className="fas fa-location-dot"></i>
              <div>
                <label>Địa chỉ:</label>
                <p>Ở đâu còn lâu mới nói</p>
              </div>
            </div>

            <div className="info-item">
              <i className="fas fa-phone"></i>
              <div>
                <label>Điện thoại:</label>
                <p>0399 760 075</p>
              </div>
            </div>

            <div className="info-item">
              <i className="fas fa-envelope"></i>
              <div>
                <label>Email:</label>
                <p>xuantruong@techkids.edu.vn</p>
              </div>
            </div>

            <div className="info-item">
              <i className="fas fa-clock"></i>
              <div>
                <label>Giờ làm việc:</label>
                <p>T2 - CN: 8:00 - 20:00</p>
              </div>
            </div>
          </div>
        </div>

        {/* Form liên hệ bên phải */}
        <div className="contact-form">
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <input
                type="text"
                name="fullName"
                value={formData.fullName}
                onChange={handleChange}
                required
              />
              <span className="highlight"></span>
              <span className="bar"></span>
              <label>Họ và tên</label>
            </div>

            <div className="form-group">
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
              <span className="highlight"></span>
              <span className="bar"></span>
              <label>Email</label>
            </div>

            <div className="form-group">
              <input
                type="tel"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
              />
              <span className="highlight"></span>
              <span className="bar"></span>
              <label>Số điện thoại</label>
            </div>

            <div className="form-group">
              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
                rows="4"
              ></textarea>
              <span className="highlight"></span>
              <span className="bar"></span>
              <label>Nội dung tin nhắn</label>
            </div>

            <button type="submit">Gửi tin nhắn</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Contact;
